import React from "react";
import video from '../../images/video.mov';
import './styles.css';

const Home = ()  => {
    return (
<div>
    <video className='video' autoPlay loop>
        <source src={video} type='video/mp4' />
    </video>
    <div className="content">
        <h1>Приглашаем тебя на нашу свадебную вечеринку</h1>
    </div>
</div>
    );
};

export default Home;
